import React, { useEffect, useState } from "react";
import { getBookings } from "../api";

export default function AdminPage({ onGoHome }) {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    (async () => {
      try {
        const data = await getBookings();
        setBookings(data);
      } catch (err) {
        console.error(err);
      }
    })();
  }, []);

  return (
    <div className="container">
      <h1>Admin Panel</h1>
      <button onClick={onGoHome}>Back to Home</button>
      {bookings.length === 0 ? (
        <p>No bookings yet.</p>
      ) : (
        <ul>
          {bookings.map(b => (
            <li key={b._id}>
              {b.tripName} - {b.userName} - {b.date} - {b.status}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
